import React from "react";
import Dashboard from "./components/Dashboard";
import styles from './style';
function App() {
return (
  <div  className="bg-primary w-full overflow-hidden">
    <div className={`bg-primary  ${styles.paddingX}${styles.flexStart}`}>
    <Dashboard />
    </div>
   
  </div>
);
};
export default App;
